  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130680 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 7 during project
  S-X905-NRT4-10 in the Great Lakes from 2010-06-15 to 2010-11-04. These data include
